const fz = require('zigbee-herdsman-converters/converters/fromZigbee');
const tz = require('zigbee-herdsman-converters/converters/toZigbee');
const exposes = require('zigbee-herdsman-converters/lib/exposes');
const reporting = require('zigbee-herdsman-converters/lib/reporting');
const m = require('zigbee-herdsman-converters/lib/modernExtend');
const e = exposes.presets;
const ea = exposes.access;

const tzLocal = {
    node_config: {
        key: ['read_sensors_delay', 'poll_rate_on', 'tx_radio_power'],
        convertSet: async (entity, key, rawValue, meta) => {
			const endpoint = meta.device.getEndpoint(2);
            const lookup = {'OFF': 0x00, 'ON': 0x01};
            const value = lookup.hasOwnProperty(rawValue) ? lookup[rawValue] : parseInt(rawValue, 10);
            const payloads = {
                read_sensors_delay: ['genPowerCfg', {0x0201: {value, type: 0x21}}],
                smart_sleep: ['genPowerCfg', {0x0216: {value, type: 0x10}}],
                tx_radio_power: ['genPowerCfg', {0x0236: {value, type: 0x28}}],
            };
            await endpoint.write(payloads[key][0], payloads[key][1]);
            return {
                state: {[key]: rawValue},
            };
        },
    },
	node_debug: {
        key: ['lower_level', 'upper_level'],
        convertSet: async (entity, key, rawValue, meta) => {
            const endpoint = meta.device.getEndpoint(2);
            const lookup = {'OFF': 0x00, 'ON': 0x01};
            const value = lookup.hasOwnProperty(rawValue) ? lookup[rawValue] : parseInt(rawValue, 10);
            const payloads = {
                lower_level: ['msSoilMoisture', {0x0502: {value, type: 0x21}}],
                upper_level: ['msSoilMoisture', {0x0503: {value, type: 0x21}}],
            };
            await endpoint.write(payloads[key][0], payloads[key][1]);
            return {
                state: {[key]: rawValue},
            };
        },
    },
	temperaturef_config: {
        key: ['temperature_offset', 'temperature_compensation', 'resolution'],
        convertSet: async (entity, key, rawValue, meta) => {
            const endpoint = meta.device.getEndpoint(1);
            const lookup = {'OFF': 0x00, 'ON': 0x01};
            const value = lookup.hasOwnProperty(rawValue) ? lookup[rawValue] : parseInt(rawValue, 10);
            const value2 = parseFloat(rawValue)*10;
            const payloads = {
                temperature_offset: ['msTemperatureMeasurement', {0x0410: {value2, type: 0x29}}],
                temperature_compensation: ['msTemperatureMeasurement', {0x0504: {value, type: 0x10}}],
                resolution: ['msTemperatureMeasurement', {0x0520: {value, type: 0x20}}],
            };
            await endpoint.write(payloads[key][0], payloads[key][1]);
            return {
                state: {[key]: rawValue},
            };
        },
    },
};

const fzLocal = {
    node_config: {
        cluster: 'genPowerCfg',
        type: ['attributeReport', 'readResponse'],
        convert: (model, msg, publish, options, meta) => {
            const result = {};
            if (msg.data.hasOwnProperty(0x0201)) {
                result.read_sensors_delay = msg.data[0x0201];
            }
            if (msg.data.hasOwnProperty(0x0216)) {
                result.smart_sleep = ['OFF', 'ON'][msg.data[0x0216]];
            }
            if (msg.data.hasOwnProperty(0x0236)) {
                result.tx_radio_power = msg.data[0x0236];
            }
            return result;
        },
    },
	node_debug: {
        cluster: 'msSoilMoisture',
        type: ['attributeReport', 'readResponse'],
        convert: (model, msg, publish, options, meta) => {
            const result = {};
            if (msg.data.hasOwnProperty(0x0502)) {
                result.lower_level = msg.data[0x0502];
            }
            if (msg.data.hasOwnProperty(0x0503)) {
                result.upper_level = msg.data[0x0503];
            }
            if (msg.data.hasOwnProperty(0x0500)) {
                result.one = msg.data[0x0500];
            }
            if (msg.data.hasOwnProperty(0x0501)) {
                result.two = msg.data[0x0501];
            }
            if (msg.data.hasOwnProperty(0x0499)) {
                result.three = msg.data[0x0499];
            }
            return result;
        },
    },
	temperaturef_config: {
        cluster: 'msTemperatureMeasurement',
        type: ['attributeReport', 'readResponse'],
        convert: (model, msg, publish, options, meta) => {
            const result = {};
            if (msg.data.hasOwnProperty(0x0410)) {
                result.temperature_offset = parseFloat(msg.data[0x0410])/10.0;
            }
            if (msg.data.hasOwnProperty(0x0504)) {
                result.temperature_compensation = ['OFF', 'ON'][msg.data[0x0504]];
            }
            if (msg.data.hasOwnProperty(0x0520)) {
                result.resolution = msg.data[0x0520];
            }
            return result;
        },
    },
	uptime: {
        cluster: 'genTime',
        type: ['attributeReport', 'readResponse'],
        convert: (model, msg, publish, options, meta) => {
            if (msg.data.hasOwnProperty('standardTime')) {
            	return {uptime: Math.round(msg.data.standardTime/60/60)};
            }
        },
    },
};

const definition = {
        zigbeeModel: ['EFEKTA_Egony_Flower'],
        model: 'EFEKTA_Egony_Flower',
        vendor: 'EFEKTA',
        description: '[Soil moisture sensor Egony_Flower, mod DIYRuZ Flower](http://efektalab.com/Egony_Flower)',
        fromZigbee: [fz.temperature, fz.soil_moisture, fz.battery, fzLocal.node_config, fzLocal.node_debug, fzLocal.temperaturef_config, fzLocal.uptime],
        toZigbee: [tz.factory_reset, tzLocal.node_config, tzLocal.node_debug, tzLocal.temperaturef_config],
        configure: async (device, coordinatorEndpoint, logger) => {
            const endpoint1 = device.getEndpoint(1);
            const endpoint2 = device.getEndpoint(2);
            const endpoint3 = device.getEndpoint(3);
            await reporting.bind(endpoint1, coordinatorEndpoint, [
                'genTime', 'msTemperatureMeasurement']);
            await reporting.bind(endpoint2, coordinatorEndpoint, [
                'genPowerCfg', 'msSoilMoisture']);
            const overrides1 = {min: 7200, max: 43200, change: 1};
            const overrides2 = {min: 60, max: 3600, change: 10};
            const overrides3 = {min: 60, max: 1800, change: 50};
            const overrides4 = {min: 60, max: 10800, change: 10};
            await reporting.batteryVoltage(endpoint2, overrides1);
            await reporting.batteryPercentageRemaining(endpoint2, overrides1);
            await reporting.batteryAlarmState(endpoint2, overrides1);
            await reporting.temperature(endpoint1, overrides2);
            await reporting.soil_moisture(endpoint2, overrides4);
        },
        icon: 'data:image/png;base64,',
        exposes: [e.soil_moisture(), e.battery(), e.battery_low(), e.battery_voltage(), e.temperature(),
		    exposes.numeric('read_sensors_delay', ea.STATE_SET).withUnit('Minutes').withDescription('Adjust Report Delay. Setting the time in minutes, by default 3 minutes')
                .withValueMin(1).withValueMax(360),
			exposes.enum('tx_radio_power', ea.STATE_SET, [-4, 0, 4]).withDescription('Set TX Radio Power)'),
			exposes.binary('smart_sleep', ea.STATE_SET, 'ON', 'OFF').withDescription('Poll rate on off'),
			exposes.numeric('uptime', ea.STATE).withUnit('Hours').withDescription('Uptime'),
			exposes.numeric('lower_level', ea.STATE_SET).withUnit('%').withDescription('The lower level of soil moisture 0% is:')
                .withValueMin(0).withValueMax(99),
			exposes.numeric('upper_level', ea.STATE_SET).withUnit('%').withDescription('The upper level of soil moisture 100% is:')
                .withValueMin(1).withValueMax(100),
			exposes.binary('temperature_compensation', ea.STATE_SET, 'ON', 'OFF').withDescription('Temperature compensation'),
			exposes.enum('resolution', ea.STATE_SET, [9, 10, 11, 12]).withDescription('Set Bit resolution DS18B20)'),
		    exposes.numeric('temperature_offset', ea.STATE_SET).withUnit('°C').withValueStep(0.1).withDescription('Adjust temperature')
                .withValueMin(-50.0).withValueMax(50.0)],
        extend: [m.illuminance()],
};

module.exports = definition;
